const dictionaryForContinents = [ 
  ["Всесвіт"],
  ["Європа"],
  ["Азія"],
  ["Африка"],
  ["Північна Америка"],
  ["Південна Америка"],
]

let paramsInSelectedTest = new URL(document.location).searchParams;
let questions = [];
let time = '';

const wayToPopups = document.getElementById("popupTestsInSelectedTest");

const subjectOfTest = paramsInSelectedTest.get("subject")
const numberOfTest = paramsInSelectedTest.get("test");

function getRandomArbitrary(min, max) {
  return Math.floor(Math.random() * (max - min) + min);
}

switch (numberOfTest) {
  case "1":
    firstGeographyTest();
    break;
  case "2":
    secondGeographyTest();
    break;
  case "3":
    thirdGeographyTest();
    break;
}

function firstGeographyTest() {
  let regionInTest = paramsInSelectedTest.get("r");
  const knowledgeInTest = paramsInSelectedTest.get("k");
  const countOfQuestionsInTest = paramsInSelectedTest.get("c");
  const timeInTest = paramsInSelectedTest.get("t");
  let timeListOfCountries = [];
  let timeListOfCapitals = [];

  // Important to be here --

  document.getElementById("svgMapContainerInTest").setAttribute("viewBox", listOfSVGContinents[regionInTest][0]);
  document.getElementById("svgMapContainerInTest").innerHTML = listOfSVGContinents[regionInTest][1];

  // --

  questions = [];
  timeListOfCountries = listOfCountries;
  timeListOfCapitals = listOfCapitals;
  for (let i = 0; i < countOfQuestionsInTest; i++) {
    let question = {
      questionText: "-",
      answer: "-",
      correctAnswer: false,
    };
    var questionText = i + 1 + ".";
    if (knowledgeInTest == 0) {
      let rnd1 = getRandomArbitrary(0, 2);
      questionText += questionsForTests[rnd1][languageId];
      if (rnd1 == 0) {
        let rnd = getRandomArbitrary(0, timeListOfCountries[regionInTest].length);
        questionText += timeListOfCountries[regionInTest][rnd][languageId];
        question["answer"] = timeListOfCountries[regionInTest][rnd][languageId];
        // timeListOfCountries[regionInTest].splice(timeListOfCountries[regionInTest].indexOf(timeListOfCountries[regionInTest][rnd]), 1);
      }
      if (rnd1 == 1) {
        let rnd = getRandomArbitrary(0, timeListOfCapitals[regionInTest].length);
        questionText += timeListOfCapitals[regionInTest][rnd][languageId];
        question["answer"] = timeListOfCountries[regionInTest][rnd][languageId];
        // timeListOfCapitals[regionInTest].splice(timeListOfCapitals[regionInTest].indexOf(timeListOfCapitals[regionInTest][rnd]), 1);
      }
    } else if (knowledgeInTest == 1) {
      questionText += questionsForTests[0][languageId];
      let rnd = getRandomArbitrary(0, timeListOfCountries[regionInTest].length);
      questionText += timeListOfCountries[regionInTest][rnd][languageId];
      question["answer"] = timeListOfCountries[regionInTest][rnd][languageId];
      // timeListOfCountries[regionInTest].splice(timeListOfCountries[regionInTest].indexOf(timeListOfCountries[regionInTest][rnd]), 1);
    } else if (knowledgeInTest == 2) {
      questionText += questionsForTests[1][languageId];
      let rnd = getRandomArbitrary(0, timeListOfCapitals[regionInTest].length);
      questionText += timeListOfCapitals[regionInTest][rnd][languageId];
      question["answer"] = timeListOfCountries[regionInTest][rnd][languageId];
      // timeListOfCapitals[regionInTest].splice(timeListOfCapitals[regionInTest].indexOf(timeListOfCapitals[regionInTest][rnd]), 1);
    }
    question["questionText"] = questionText;
    questions.push(question);
  }

  let arrOfCountries = document.querySelectorAll("#svgMapContainerInTest .country");
  let numberOfQuestion = 0;

  wayToActivatedTest.classList += " active";
  wayToActivatedTest.childNodes[1].innerText = questions[0]["questionText"];

  arrOfCountries.forEach((countryFromArr) => {
    countryFromArr.setAttribute("data-title", listOfCountries[regionInTest][countryFromArr.dataset.idofthecountry][languageId]);
    countryFromArr.setAttribute("name", listOfCountries[regionInTest][countryFromArr.dataset.idofthecountry][languageId]);
    countryFromArr.addEventListener("mouseenter", function () {
      document.getElementsByName(this.dataset.title).forEach((e) => {
        if (e.classList == "country") {
          e.setAttribute("class", "country hover");
        }
      });
    });
    countryFromArr.addEventListener("mouseleave", function () {
      arrOfCountries.forEach((e) => {
        if (e.classList == "country hover") {
          e.setAttribute("class", "country");
        }
      });
    });
    countryFromArr.addEventListener("dblclick", function () {
      if (this.dataset.title == questions[numberOfQuestion]["answer"]) {
        wayToActivatedTest.childNodes[3].childNodes[1].innerText = parseInt(wayToActivatedTest.childNodes[3].childNodes[1].innerText) + 1;
        questions[numberOfQuestion]["correctAnswer"] = true;
      }
      numberOfQuestion += 1;
      if (questions[numberOfQuestion]) {
        wayToActivatedTest.childNodes[1].innerText = questions[numberOfQuestion]["questionText"];
      } else {
        wayToPopups.classList += " active";
        finishTest();
        //startFinishGeographyTest1();
      }
    });
  });

  setTimeout(() => {
    wayToPopups.classList += " active";
    // finishedBeforeEnd = false;
    finishTest();
  }, timeInTest * 60000);

  wayToActivatedTest.childNodes[5].addEventListener("click", function () {
    wayToPopups.classList += " active";
    wayToPopups.querySelector(".popup-body[data-testStage='3']").classList += " active";
  });

  function finishTest() {
    regionInTest = dictionaryForContinents[regionInTest][languageId];

    sessionStorage.setItem("stageOfTest", "finished")
    if(sessionStorage.getItem("user")) {
      sessionStorage.setItem("downloadInformationInBD", true)
    }

    sessionStorage.setItem("questions", JSON.stringify(questions))
    sessionStorage.setItem("subjectOfTest", subjectOfTest)
    sessionStorage.setItem("numberOfTest", numberOfTest);
    sessionStorage.setItem("region", regionInTest);
    sessionStorage.setItem("numberOfQuestions", countOfQuestionsInTest);
    sessionStorage.setItem("correctedAnswers", wayToActivatedTest.childNodes[3].childNodes[1].innerText);
    sessionStorage.setItem("time", time);

    document.location.href = "map.html"
  }

}

function secondGeographyTest() {}

function thirdGeographyTest() {}

function timerInTest() {
  let sec = 0;
  let min = 0;

  setInterval(tick, 1000);

  function tick() {
    sec++;
    if (sec >= 60) {
      sec = 0;
      min++;
    }
    time = (min < 10 ? "0" + min : min) + ":" + (sec < 10 ? "0" + sec : sec);
    //console.log(time)
  }
}
